import React, { useState, useEffect } from 'react';
import axios from 'axios';
import DataTable from './components/DataTable';
import ScatterPlot from './components/ScatterPlot';
import { createTheme, ThemeProvider, CssBaseline, Button, TextField } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { Tabs, Tab } from '@material-ui/core';
import { Brightness4, Brightness7 } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  app: {
    backgroundColor: theme.palette.background.default,
    color: theme.palette.text.primary,
    minHeight: '100vh',
    padding: theme.spacing(2),
  },
  toggleButton: {
    position: 'absolute',
    top: theme.spacing(2),
    right: theme.spacing(2),
  },
  tabContent: {
    marginTop: theme.spacing(2),
  },
  scatterPlotContainer: {
    height: '400px',
    marginBottom: theme.spacing(2),
  },
}));

const MainComponent = () => {
  const classes = useStyles();
  const [data, setData] = useState([]);
  const [keywords, setKeywords] = useState('');
  const [darkMode, setDarkMode] = useState(false);
  const [tabIndex, setTabIndex] = useState(0);
  const [totalResults, setTotalResults] = useState(0);

  useEffect(() => {
    fetchData(keywords);
  }, [keywords]);

  const fetchData = async (keywords) => {
    const apiKey = process.env.REACT_APP_JUNGLE_SCOUT_API_KEY;
    const keyName = process.env.REACT_APP_JUNGLE_SCOUT_KEY_NAME;
    const url = `https://developer.junglescout.com/api/product_database_query?marketplace=us&sort=-revenue&page[size]=50`;

    const headers = {
      'Authorization': `${keyName}:${apiKey}`,
      'X-API-Type': 'junglescout',
      'Accept': 'application/vnd.junglescout.v1+json',
      'Content-Type': 'application/vnd.api+json',
    };

    const payload = JSON.stringify({
      "data": {
        "type": "product_database_query",
        "attributes": {
          "include_keywords": [keywords],
          "exclude_unavailable_products": true,
        }
      }
    });

    try {
      const response = await axios.post(url, payload, { headers });
      if (response.data && response.data.data) {
        console.log('API response data:', response.data.data); // Log the API response
        setData(response.data.data);
        setTotalResults(response.data.data.length);
      } else {
        console.error('Invalid API response:', response);
        setData([]);
        setTotalResults(0);
      }
    } catch (error) {
      console.error('API request failed:', error);
      setData([]);
      setTotalResults(0);
    }
  };

  const theme = createTheme({
    palette: {
      type: darkMode ? 'dark' : 'light',
    },
  });

  const handleToggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  const handleTabChange = (event, newIndex) => {
    setTabIndex(newIndex);
  };

  const handleKeywordChange = (event) => {
    setKeywords(event.target.value);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div className={classes.app}>
        <Button
          className={classes.toggleButton}
          onClick={handleToggleDarkMode}
          startIcon={darkMode ? <Brightness7 /> : <Brightness4 />}
        >
          {darkMode ? 'Light Mode' : 'Dark Mode'}
        </Button>
        <TextField
          label="Enter keywords"
          value={keywords}
          onChange={handleKeywordChange}
          variant="outlined"
          fullWidth
          margin="normal"
        />
        <Tabs value={tabIndex} onChange={handleTabChange} centered>
          <Tab label="All Results" />
          <Tab label="Price Segments" />
          <Tab label="Winners" />
        </Tabs>
        <div className={classes.tabContent}>
          <div className={classes.scatterPlotContainer}>
            <ScatterPlot data={data} />
          </div>
          <p>Total results: {totalResults}</p> {/* Display total results */}
          {tabIndex === 0 && <DataTable data={data} tabIndex={tabIndex} />}
          {tabIndex === 1 && <DataTable data={data} tabIndex={tabIndex} />}
          {tabIndex === 2 && <DataTable data={data} tabIndex={tabIndex} />}
        </div>
      </div>
    </ThemeProvider>
  );
};

export default MainComponent;
